import { useState } from "react";

function RatingSelect() {
  const [selected, setSelected] = useState("10");

  return (
    <ul className="rating">
      <li key={`rating-${i + 1}`}>
        <input
          type="radio"
          id={`num${i + 1}`}
          name="rating"
          value={i + 1}
          onChange={handleChange}
          checked={selected === i + 1}
        />
        <label htmlFor={`num${i + 1}`}>{i + 1}</label>
      </li>
    </ul>
  );
}

export default RatingSelect;
